import React from 'react';
import logo from '../icons/home_icon_25x25.svg';

function Footer() {

    return (
        <div>
            <ul>
            <li><img src={logo} width="50" height="50" alt="ForesterLogo" /></li>
            </ul>
        </div>
    )
}

export default Footer;
